        v = repb(v.replace(unique,unit)).replace(unit,unique)
        v = re.sub(expc, e, v)
        v = re.sub(expd, h, v)
        v = re.sub(expb, j, v) # 从中括号中的内容获取解析式，并计算
        v = repb(v.replace(unique,unit))
